import React, { useState } from 'react';

const App = () => {
  const [uploads, setUploads] = useState([]);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    const currentDate = new Date().toLocaleString();
    const newUpload = { file, date: currentDate };
    setUploads([...uploads, newUpload]);
  };

  return (
    <div>
      <h1>Land Team Site Visit</h1>

      <h2>Last Uploads</h2>
      <input type="file" onChange={handleFileUpload} />

      {uploads.length > 0 && (
        <table>
          <thead>
            <tr>
              <th>File Name</th>
              <th>Date Uploaded</th>
            </tr>
          </thead>
          <tbody>
            {uploads.map((upload, index) => (
              <tr key={index}>
                <td>{upload.file.name}</td>
                <td>{upload.date}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      <h2>Land Evaluation Checklist</h2>
      {/* Your checklist content goes here */}
    </div>
  );
};

export default App;
